itElement, "kiste") == true) then				if(abgelieferte_kiste[hitElement]) then return end				local x, y, z = getElementPosition(localPlayer)				local x2, y2, z2 = getElementPosition(hitElement)				if(getDistanceBetweenPoints3D(x, y, z, x2, y2, z2) > 3.5) then return end				local i = tonumber(getElementData(hitElement, "typ"))				local lohn2 = 0				if(i == 3) then lohn2 = 10 end				if(i == 2) then lohn2 = 25 end				if(i == 1) then lohn2 = 35 end				abgelieferte_kiste[hitElement] = hitElement				vanishElement(hitElement)				vanishElement(pfeil[hitElement])				outputChatBox("Kiste abgeliefert!", 200, 200, 0)				abgeliefert = abgeliefert+1				triggerServerEvent("onGabelstaplerJobAbgeliefert", localPlayer, lohn2)			end		end)	endendaddEventHandler("onload_gabelstaplerjob", localPlayer, load_gabelstaplerjob)local function quit_gabelstaplerjob()	for index, p in pairs(pfeil) do		if(isElement(p)) then			destroyElement(p)		end	end	for i = 1, #abstellcol, 1 do		destroyElement(abstellcol[i])		destroyElement(abstellmarker[i])	end	abgeliefert = 0	doing = false	abgelieferte_kiste = nil	abgelieferte_kiste = {}	destroyKisten()	loadKisten()endaddEventHandler("onClientGabelstaplerJobQuit", localPlayer, quit_gabelstaplerjob)addEventHandler("onClientGabelstaplerJobHit", localPlayer, function()	if(Guivar == 1) then return end	if(doing == true) then return end	Guivar = 1	showCursor(true)	local X, Y, Width, Height = getMiddleGuiPosition(380,130)	local Fenster = dgsCreateWindow(X, Y, Width, Height, "Gabelstaplerjob",false,tocolor(255,255,255),nil,nil,guimaincolor,nil,nil,nil,true)	local Label = dgsCreateLabel(8,22,356,66,"Möchtest du den Gabelstapler-Job starten?\nLohn pro Kiste: "..lohn..""..Tables.waehrung.."",false,Fenster)	dgsLabelSetVerticalAlign(Label,"center")	dgsLabelSetHorizontalAlign(Label,"center",false)	dgsSetFont(Label,"default")	local Knopf1 = dgsCreateButton(10,70,100,27,"Ja",false,Fenster)	local Knopf2 = dgsCreateButton(260,70,100,27,"Nein",false,Fenster)		-- Ja bitte --	addEventHandler("onDgsMouseClick", Knopf1, function(btn,state)		if btn == "left" and state == "down" then end		Guivar = 0		showCursor(false)		destroyElement(Fenster)		triggerServerEvent("onGabelstaplerJobStart", localPlayer)		load_gabelstaplerjob()	end, false)		-- Nein danke --	addEventHandler("onDgsMouseClick", Knopf2, function(btn,state)			if btn == "left" and state == "down" then end			Guivar = 0			showCursor(false)			destroyElement(Fenster)	end, false)end)-- FUNKTIONEN NICHT RAUSNEHMEN --local v_e_doing = {}function vanishElement(theElement)	if(v_e_doing[theElement] == true) then return end	v_e_doing[theElement] = true	for i = 1, 25 do		setTimer ( setElementAlpha, 100 * i, 1, theElement, 255 / 25 * ( 25 - i ) )	end	setTimer ( destroyElement, 2500, 1, theElement )endfunction getMiddleGuiPosition(lol, lol2)	local sWidth, sHeight = guiGetScreenSize()     local Width,Height = lol, lol2    local X = (sWidth/2) - (Width/2)    local Y = (sHeight/2) - (Height/2)		return X, Y, Width, Heightend